/* ==========================================================
  2. Initiations / Default Functions
*/

$(document).ready(function(){

  // 2.0 Toggle JS Class
  $("html").removeClass('no-js').addClass('js');

  // 2.1 Slideshow
  $("#slider").responsiveSlides();

  // 2.2 Menu for Mobile Devices
  // If JS is enabled, attach the 'hide' class (only affects mobiles - special media query class)
  $('.navigation').prepend('<a href="#" class="nav-toggle nodesktop notablet nomobile">Menu <span class="arrow">+</span></a>');
  $(".nav-toggle").removeClass('nomobile').addClass('showmobile');
  $('.menu').addClass("nomobile");

  // When the navigation button is clicked, toggle menu
  $(".nav-toggle").click(function() {
    if ( $('.menu:visible').length < 1 ) {
      $('.menu').stop(true, true).slideDown(200, function() {
        $('.nav-toggle .arrow').html('-');
        $('.nav-toggle').toggleClass('active');
        $(this).removeClass('nomobile').removeAttr('style');
      });
    } else {
      $('.menu').stop(true, true).slideUp(200, function() {
        $('.nav-toggle .arrow').html('+');
        $('.nav-toggle').toggleClass('active');
        $(this).addClass('nomobile').removeAttr('style');
      });
    };
    return false;
  });


  // 2.3 Stick Navigation
  $(window).scroll(function() {
    var windowWidth = $(window).width();
    if ( windowWidth > 960 ) { // if in desktop mode
      $('.header-inner').addClass('sticky');
      
    } // end if
  });

  $(window).resize(function() {
    var windowWidth = $(window).width();
    if ( windowWidth < 960 ) { // if in mobile mode
      $('.header-inner').removeClass('sticky');
    } // end if
  });

  // Lightbox
  $('.gallery a').lightbox();

  // Calendar Widget
  $('.datetime').datepicker({ dateFormat: 'mm-dd-yy'});

  // Contact Form
  $('#contact-us form').submit(function() {
    var self = $(this);
    var formURL = self.attr('action');
    self.find('input[type=submit]').attr('disabled','disabled');
    $.ajaxSetup ({
      // Disable caching of AJAX responses
      cache: false
    });
    $.ajax({
      url: formURL,
      type: "post",
      data: self.serialize(),
      success: function(response) {
        var errors = $(response).find('.error').first();
        var submitMessage = $(response).find('.alert');
        if ( errors.length ) {
          alert(errors.text());
        } else {
          $('#contact-us').fadeOut(function() {
            $(this).html(submitMessage);
          });
        }
      },
      error:function() {

      },
      complete:function() {
        $('#contact-us').fadeIn();
        self.find('input[type=submit]').removeAttr('disabled');
      }
    });
    return false;
  });


}); // end document ready